import axios from "axios";
import { useState } from 'react';


function Fourth() {

    const [ output, setOutput ] = useState('0000')

    {axios
        .put("/test/", {name: 4,date: 6})
        .then((res)=>setOutput(res.data))}

    return (
        <div className='container'>
            Yo Yo this is fourth
            <input type='string' id='testinput'/>
            {output}
        </div>
    )
}

export default Fourth
